import { Component } from "react";
import React from "react";
import './css/feed.css'
import { useState } from "react";

export default class Feed extends Component {
    constructor(props) {
        super(props);
        this.state = {
            selectedFileImg: null,
        }
        handleImg = (e) => {
            this.setState({ selectedFileImg: e.target.files[0] })
        }
    }
    render() {
        return (
            <div className="feed">
                <div className="feed-container">
                    <button className="feedProfileBut">
                        <div className="feedPro">
                            <span className="material-symbols-outlined">account_circle</span>
                            <p>to anyone</p>
                        </div>
                    </button>
                    <div className="editor" 
                    contentEditable="true" 
                    role="textbox" 
                    aria-multiline="true" 
                    data-placeholder="write anything what you want" 
                    aria-label="write Post">
                        <p></p>
                    </div>
                    <div className="postTools">
                        <div className="photo">
                            <input 
                            type="file" 
                            name="uploadPhotoForPost" 
                            id="uploadPhotoForPost" 
                            accept=".png, .jpg, .webp" 
                            onChange={this.handleImgChange}
                            />
                            <label forHTML="uploadPhotoForPost" className="fileLabel">Upload Photo</label>
                        </div>
                        <div className="doc">

                        </div>
                        <div className="postButton">

                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
